import React from "react";
import LeftContainer from "./Components/LeftContainer";
import RightContainer from "./Components/RightContainer";

const Page = () => {
  return (
    <div className="flex flex-row ">
      <div>
        <LeftContainer />
      </div>
      <div>
        <RightContainer />
      </div>
    </div>
  );
};

export default Page;
